import "./App.css";
import React, { useState } from "react";
import { SearchForm, TransactionResult, Spinner } from "./Components";

function App() {
    const [loading, setLoading] = useState(true);

    return (
        <>
            {loading ? (
                <Spinner />
            ) : (
                <>
                    <SearchForm />
                    <TransactionResult />
                </>
            )}
        </>
    );
}

export default App;
